import { ADD_DIARY } from '../actions/types';

const initialState = {
    diaries: [],
  };

export default function diaryReducer (state = initialState, action) {
    switch (action.type) {
        case ADD_DIARY:
            console.log(action);
           return {
               ...state,
               diaries: action.payload
           }
        default:
            return state;
    }
}
